import {BrowserRouter, Route, Routes} from 'react-router-dom'
import HomeScreen from "./screen/HomeScreen";
function App() {
  return (
    <BrowserRouter>
    <div>
      <header>
      <a href="/">amazona</a>
      </header>
      <main>
        <Routes>
          <Route path="/" element={<HomeScreen/>}/>
          <Route path="/" element={<HomeScreen/>}/>
        </Routes>

      </main>
    </div>
</BrowserRouter>
  );
}

export default App;
